import React from "react";

export default function Profile() {
  return (
    <>
      <div>This is home component</div>
      <div>
        <a>
          <i className="bi bi-facebook" />
        </a>
        <a>
          <i className="bi bi-youtube" />
        </a>
        <a>
          <i className="bi bi-linkedin" />
        </a>
      </div>
    </>
  );
}
